INSERT INTO `kuliner` (`id_kuliner`, `nama_kuliner`, `deskripsi_kuliner`, `lokasi_kuliner`, `gambar_kuliner`) VALUES
(1, 'Rawon Rosobo', 'Rawon Rosobo Jombang merupakan salah satu rumah makan yang menyediakan menu masakan rawon khas jawa timuran, sangat terkenal bagi masyarakat yang sering melewati jalur jombang – mojokerto.\r\nRawon di rumah makan rosobo ini cukup berbeda dari rawon yang sering kebanyakan kita jumpai yang Biasanya untuk daging sapinya di potong kecil kemudian di campur kuah serta tauge. Namun di rumah makan rosobo ini daging empal sapi di potong cukup besar-besar jadi sangat dominan di atas nasinya, dan kuahnya juga enak dengan rasa yang agak manis, sangat cocok buat pengunjung yang suka dengan rasa yang manis, n', 'https://goo.gl/maps/UKeMxmzHwCZss3k86 ', );
INSERT INTO `kuliner` (`id_kuliner`, `nama_kuliner`, `deskripsi_kuliner`, `lokasi_kuliner`, `gambar_kuliner`) VALUES
(2, 'Bakso Mama', 'Salah satu makanan bakso yang sangat ramai pembeli dengan membuka beberapa cabang di wilayah Jombang bahkan hingga luar Jombang. Salah satu cabangnya yakni Bakso Mama 1 (Pusat) di Jalan Panglima Sudirman No. 161 Denanyar, Kabupaten Jombang. Di Jombang sendiri terdapat 3 cabang, masing-masing di denanyar, jombang kota, dan diwek. Menurut informasi yang dihimpun kedai tersebut buka mulai pukul 09.00 WIB hingga 21.00 WIB setiap harinya.', 'https://maps.app.goo.gl/WXpKPpYq3SaZ34cy5 ', );
INSERT INTO `kuliner` (`id_kuliner`, `nama_kuliner`, `deskripsi_kuliner`, `lokasi_kuliner`, `gambar_kuliner`) VALUES
(3, 'Ayam Panggang Bu Tris', 'Ayam Panggang Bu Tris adalah kuliner legendaris yang telah berdiri sejak tahun 1986 di Jombang, Jawa Timur. Warung ini berhasil menciptakan resep ayam panggang yang begitu khas dan menjadi favorit di kota Jombang. Terletak di Jalan KH. Wahab Hasbullah, Tambakberas, tempat ini buka setiap hari mulai pukul 08.00 hingga 21.00.', ' https://goo.gl/maps/osPbTRo7nHb2HPrV6 ', );
INSERT INTO `kuliner` (`id_kuliner`, `nama_kuliner`, `deskripsi_kuliner`, `lokasi_kuliner`, `gambar_kuliner`) VALUES
(4, 'Soto Dok Cak Kadar', 'Soto Dok Cak Kadar adalah kuliner legendaris sejak tahun 1978 di Jombang, Jawa Timur. Ciri khasnya adalah cara penyajiannya yang unik dengan menggedor meja dengan menggunakan botol kecap, menghasilkan suara “dok” yang khas. Menu andalan Soto Dok Cak Kadar adalah Soto Ayam yang disajikan dengan kuah kaldu gurih dan kaya rempah. Harga , mulai dari Rp 15.000/porsi, menjadikannya pilihan kuliner yang tepat untuk semua kalangan. Buka setiap hari pukul 16.00 - 23.00 WIB.', 'https://goo.gl/maps/fGjJgcmGXretUZcj9 ', );
INSERT INTO `kuliner` (`id_kuliner`, `nama_kuliner`, `deskripsi_kuliner`, `lokasi_kuliner`, `gambar_kuliner`) VALUES
(6, 'Pecel Pincuk Bu Djiah ', 'Nasi Pecel Pincuk Bu Djiyah adalah sebuah warung kuliner legendaris sejak tahun 1997 Menu andalan dari Nasi Pecel Pincuk Bu Hj. Djiyah adalah pecel pincuk. Dalam satu porsi pecel, penyajiannya hampir sama dengan nasi pecel lainnya. Terdiri dari nasi putih yang disajikan dalam pincuk, kemudian ditambahkan dengan sayuran seperti rebusan kangkung, bunga pepaya, daun pepaya, mentimun, kecambah, kemangi, dan bendoyo. Semua ini disiram dengan bumbu pecel yang khas dan peyek yang gurih. Selain pecel, warung ini juga menyajikan nasi rawon dengan kuah yang segar.', 'https://goo.gl/maps/zJUox7v2ipEsuhFb9 ', );

