(1, 'Kedung Cinet', 'Kedung Cinet adalah sebuah ngarai di kawasan tengah hutan yang dikelilingi oleh tebing bebatuan kapur berukir yang berada di Desa Klitih, Kecamatan Plandaan, Kabupaten Jombang, Jawa Timur. Kedung Cinet menjadi salah satu Pariwisata di Jombang yang dikenal sebagai spot swafoto yang menarik. \r\nKedung Cinet menyuguhkan pemandangan ngarai dengan dinding batu yang sangat indah. Bebatuan dengan warna dan bentuk yang unik dan menawan. Sehingga menjadi kesatuan pemandangan alam yang sangat mempesona.\r\n', 'Pojok Klitih, Plandaan ', 'https://maps.app.goo.gl/eqW5cxjkkm6C6BFK9 ', '07:00:00', '16:00:00', );
INSERT INTO `wisata` (`id_wisata`, `nama_wisata`, `deskripsi_wisata`, `lokasi_wisata`, `tautan_maps`, `jam_buka`, `jam_tutup`, `gambar_wisata`) VALUES
(2, 'Air Terjun Tretes', 'Air Terjun Tretes, terletak di Jombang, Jawa Timur, adalah sebuah oase alami yang menakjubkan di tengah keindahan alam yang masih terjaga. Air Terjun Tretes menawarkan pemandangan yang memesona dengan air yang jatuh dari ketinggian, menciptakan suasana yang menenangkan dan menyegarkan. Di sekitar air terjun, terdapat hutan yang hijau dan pepohonan yang rimbun, menambah pesona alaminya', 'Galengdowo, Wonosalam', 'https://maps.app.goo.gl/DaZ7jgttJk5F8dQt5 ', '08:00:00', '16:00:00', );
INSERT INTO `wisata` (`id_wisata`, `nama_wisata`, `deskripsi_wisata`, `lokasi_wisata`, `tautan_maps`, `jam_buka`, `jam_tutup`, `gambar_wisata`) VALUES
(3, 'Candi Rimbi', 'Candi Rimbi berlokasi di Desa Pulosari, Kec. Bareng, Kab. Jombang. Runtuhan Candi Rimbi ditemukan oleh orang Inggris yang bernama Alfred Wallace, ketika melewati tempat itu saat mengoleksi tanaman di Wonosalam sekitar akhir abad 19. Daerah ini terletak di kaki sebelah barat gunung Anjasmoro, berada diantara hunian penduduk,persawahan dan  hutan lebat di sekelilingnya serta pemandangan yang indah. Candi Rimbi adalah peninggalan agama Hindu dari masa Klasik Majapahit merupakan candi pendharmaan Ratu Tribhuwana Wijayatunggadewi ibunda dari Prabu Hayam Wuruk. Candi ini juga sering disebut Cungkup ', 'Ngrimbi, Bareng', 'https://maps.app.goo.gl/eve2b5eTbUAwndCD8 ', '08:00:00', '16:00:00', );

